import React from "react";
import Avatar from "./Avatar"
import Detail from "./Detail";

function Card(props)
{
    return(
        <div className="card">
        <div className="top">
          <h2 className="name">{props.name}</h2>
          <Avatar img={props.img}/>
        </div>
        <Detail info={props.phone}/>
        <Detail info={props.email}/>
      </div>
    );
}

export default Card;
